def _flatten_pairs(na_nb):
    if len(na_nb) == 0:
        return []
    first = na_nb[0]
    # se já for par [na, nb]
    if isinstance(first[0], (int, float)):
        return na_nb
    # senão, assume-se lista de linhas -> achata
    return [pair for row in na_nb for pair in row]

def _flatten_matrix(mat):
    return [v for row in mat for v in row]

def find_alphas_scalar(eta_a, eta_b):
    na_nb_flat = _flatten_pairs(na_nb)
    a1 = _flatten_matrix(alpha1)
    a2 = _flatten_matrix(alpha2)
    a3 = _flatten_matrix(alpha3)

    if not (len(na_nb_flat) == len(a1) == len(a2) == len(a3)):
        raise ValueError(
            f"Length mismatch: na_nb has {len(na_nb_flat)} pairs, alfas lengths are {len(a1)},{len(a2)},{len(a3)}"
        )

    best_idx = None
    best_dist = float('inf')
    for i, (na_t, nb_t) in enumerate(na_nb_flat):
        d = (na_t - eta_a)**2 + (nb_t - eta_b)**2
        if d < best_dist:
            best_dist = d
            best_idx = i

    return a1[best_idx], a2[best_idx], a3[best_idx]

def find_alphas(eta_a, eta_b):
 eta_a = np.atleast_1d(eta_a)
 eta_b = np.atleast_1d(eta_b)

 a1 = np.zeros_like(eta_a, dtype=float)
 a2 = np.zeros_like(eta_a, dtype=float)
 a3 = np.zeros_like(eta_a, dtype=float)

 for i in range(len(eta_a)):
  a1[i], a2[i], a3[i] = find_alphas_scalar(eta_a[i], eta_b[i])

 return a1, a2, a3
